import React,{Component} from "react";
import {Button} from 'react-bootstrap';
import './Signin.css'
import Visibility from "@material-ui/icons/Visibility";
import IconButton from "@material-ui/core/IconButton";
import VisibilityOff from "@material-ui/icons/VisibilityOff";


class SignIn extends Component{
    constructor(props){
        super(props);
        this.state={
            email:"",
            password:"",
            showPassword: false,
        }
        
        this.handleChange = this.handleChange.bind(this);
        this.handleLogin = this.handleLogin.bind(this);
        this.handleClickShowPassword=this.handleClickShowPassword.bind(this)
    };
    handleChange=(event)=> {
        this.setState({ [event.target.name]: event.target.value });
      }

     handleLogin=(event)=>{
        event.preventDefault();
        
        var roomData = {
         passcode: this.state.passcode,
         roomId: this.state.roomId
     }
     
     
    }
     handleClickShowPassword = () => {
        this.setState({showPassword: !this.state.showPassword });
      };

    render(){
        return(
            <React.Fragment>
            <form onSubmit={this.handleLogin} className="sign-form-fields">
          

          <div className="form-row-grid">
              <div className="signup-heading">Sign In</div>   
          </div>
          <div className="" >
          <div className="form-label-input-grid">
              <label>Email:</label>
                <div className="login-row-grid-input" >
                <input className="login-textbox"
                           required
                           type="email"
                           name="userEmail"
                           value={this.state.userEmail}
                           onChange={this.handleChange}/>
                </div>   

              </div>

              <div className="form-label-input-grid">
                   <label>Passcode:</label>
                   <div className="login-row-grid-input" >
                    <input className="login-textbox"
                           required
                           type={this.state.showPassword ? "text" : "password"}
                           name="passcode"  
                           value={this.state.passcode}
                           onChange={this.handleChange}/>
                   
                   <Button className="login-page-button">
                        <IconButton className="eye-icon"
                            onClick={this.handleClickShowPassword}
                             >
                    {this.state.showPassword ? <Visibility /> : <VisibilityOff />}
                        </IconButton>
                    </Button>
                </div> 
              </div>

          </div>
          <Button  className="signin-button"
               type="submit"
               > Join Room</Button>
              
   </form>
            </React.Fragment>
        )
    }
}export default SignIn;
